import React from 'react'
import Directory from '../../components/directory/Directory'
import "./HomePage.scss"

function HomePage() {
    useEffect(() => {
        axios.get('https://react-my-burger-4a0ef-default-rtdb.firebaseio.com/ingredients.json').then(res => { console.log(res.data); })
    }, [])
    return (
        <div className="homepage">
            <Directory />
        </div>
    )
}

export default HomePage
